    // First navbar item
    {
        title: 'Program 1',
        path: '/programs/program1',
        cName: 'dropdown-link'
    },
    // Second navbar item
    {
        title: 'Program 2',
        path: '/programs/program2',
        cName: 'dropdown-link'
    },
    // Third navbar item
    {
        title: 'Program 3',
        path: '/programs/program3',
        cName: 'dropdown-link'
    },
    // Fourth navbar item
    {
        title: 'Program 4',
        path: '/programs/program4',
        cName: 'dropdown-link'
    },
    // Fifth navbar item
    {
        title: 'Program 5',
        path: '/programs/program5',
        cName: 'dropdown-link'
    },
]
